const Playview = () =>{
    return (<div className="text-white">
        <div className="text-2xl font-semibold mb-6">
            Focus
        </div>
        <div className="w-full flex justify-between space-x-4">
            <Card title="Taylor Swift" description="Best Of Taylor Swift" />
            <Card title="Selena Gomez" description="Best Of Selena Gomez" />
            <Card title="Ariana Grande" description="Best Of Ariana Grande" />
            <Card title="Lana Del Rey" description="Best Of Lana Del Rey" />
            <Card title="Pitbull" description="Best Of Pitbull" />
        </div>
    </div>
    );
};

const Card =({title,description,imgurl}) => {
    return(
        <div className="bg-black bg-opacity-50 w-1/5 p-4 rounded-lg">
            <div className="py-4">
                <img className="w-full rounded-md" alt="card" src={imgurl} />
            </div>
            <div className="text-white  py-3">{title}</div>
            <div className="text-gray-500 text-sm">{description}</div>

        </div>
    );
};


export default Playview;
